sys_variable_value.value:
(function execute(inputs, outputs) {
    if(inputs.status == "200")
    {
        var responseBody = JSON.parse(inputs.response)
        outputs.display_text = responseBody.DisplayText;
        outputs.duration = responseBody.Duration;
        outputs.offset = responseBody.Offset;
        outputs.recognition_status = responseBody.RecognitionStatus;
        if(inputs.format == "detailed") {
            outputs.NBest = responseBody.NBest;
        }
    } else {
        throw new Error(inputs.response);
    }
})(inputs, outputs);

